import React, {Component} from 'react';

export default class Calendar extends Component{


  state = {
    loading: true,

  }


  render(){

    const calendarTitle = !this.state.loading ?
                          (this.state.month+" "+this.state.day+", "+this.state.year) :
                          ("Loading...");

    return(
      <table>
        <tr>
          <th>{calendarTitle}</th>
        </tr>
      </table>
    )
  }
}
